// import React, { useEffect } from "react";
import {useParams } from "react-router-dom";



function ViewNote(props){
    const {id} = useParams();
    const noteObject = props.notesObjects.find(note => note.ID === id.slice(1));
    console.log(id)
    if (!noteObject) {
        return <div>Note not found</div>;
    }
    return(
        <div className="test">

                <div className="editingHeader">
                    <div className='div1'>
                        <div className="viewingHeaderTitle">{noteObject.Title}</div>
                        <div className="viewingHeaderDate">{noteObject.Date}</div>
                    </div>

                    <div className='div2'>
                        <button className="viewingHeaderSave editButton">Edit</button>
                        <button className="editingHeaderDelete editButton">Delete</button>
                    </div>


                 </div>
                 <div className="content">{noteObject.noteContent}</div>

                 </div>

    )
}

export default ViewNote;
